INSERT INTO `v1_ca91bfe1895e62aa90e36ac3b4d6c63629e3ed91ce750f2342ed536715c354ee` VALUES (105, "仲間と夏を楽しむ、夏海の魔法士。自分を変えたいという固い決意で、障害物を無効化して走り続ける。", 0, 1, 1, 0, 1, 160, 1, 122601, 1.5, 110, 0.029, 101);
INSERT INTO `v1_ca91bfe1895e62aa90e36ac3b4d6c63629e3ed91ce750f2342ed536715c354ee` VALUES (111, "太陽よりも輝く、夏海の元気娘。　持ち前の身体能力で、どんなコースも柔軟に対応し、駆け抜ける。", 0, 2, 2, 1, 3, 120, 0, 122401, 2.5, 105, 0.014, 102);
INSERT INTO `v1_ca91bfe1895e62aa90e36ac3b4d6c63629e3ed91ce750f2342ed536715c354ee` VALUES (105, "波打ち際に煌めく、夏海の剣士。　日々の鍛錬で鍛えた脚で、長い距離も速度を落とさず走り切る。", 1, 3, 3, 0, 2, 350, 0, 122501, 2.5, 110, 0.017, 103);
INSERT INTO `v1_ca91bfe1895e62aa90e36ac3b4d6c63629e3ed91ce750f2342ed536715c354ee` VALUES (105, "海の幸に目がない、渚のお姫様。　『王家の装備』の力を解放し、障害物をものともせず前へと進む。", 0, 4, 4, 1, 3, 130, 0, 107501, 1.5, 110, 0.016, 104);
INSERT INTO `v1_ca91bfe1895e62aa90e36ac3b4d6c63629e3ed91ce750f2342ed536715c354ee` VALUES (105, "海でも主さまをお世話する、白浜の巫女。精霊の力で自身を加速させ、誰よりも速くゴールを目指す。", 0, 5, 5, 0, 1, 160, 1, 107601, 2.5, 110, 0.014, 105);
INSERT INTO `v1_ca91bfe1895e62aa90e36ac3b4d6c63629e3ed91ce750f2342ed536715c354ee` VALUES (103, "水着姿を恥じらう、ツンデレ猫娘。お得意の魔法で、対戦相手の走りを妨害し、レースを有利に進める。", 1, 6, 6, 0, 2, 255, 0, 107801, 3.5, 120, 0.029, 106);
INSERT INTO `v1_ca91bfe1895e62aa90e36ac3b4d6c63629e3ed91ce750f2342ed536715c354ee` VALUES (103, "優雅に浜を駆ける、真夏のマホ姫。しゃなりしゃなりと、雅な身のこなしで障害物を跳び越えていく。", 0, 7, 7, 0, 1, 160, 1, 110601, 3.5, 120, 0.013, 107);
INSERT INTO `v1_ca91bfe1895e62aa90e36ac3b4d6c63629e3ed91ce750f2342ed536715c354ee` VALUES (103, "浜の平和を守る、真夏の狼娘。　　獣人の強靭なスタミナで、レース　後半にスパートをかける。", 1, 8, 8, 0, 2, 350, 0, 110401, 2.5, 110, 0.014, 108);
INSERT INTO `v1_ca91bfe1895e62aa90e36ac3b4d6c63629e3ed91ce750f2342ed536715c354ee` VALUES (100, "浜に力強く舞う、真夏の南国娘。　レースの喧噪の中でも精神を乱さず後半に大きな捲りを見せる。", 0, 9, 9, 1, 3, 130, 0, 110501, 1.5, 105, 0.012, 109);
INSERT INTO `v1_ca91bfe1895e62aa90e36ac3b4d6c63629e3ed91ce750f2342ed536715c354ee` VALUES (103, "浜の事件を嗅ぎ付けた、真夏の　　名探偵。高い推理力と魔法で、的確に対戦相手の走りを乱す。", 0, 10, 10, 0, 1, 200, 1, 115701, 2.5, 105, 0.014, 110);
INSERT INTO `v1_ca91bfe1895e62aa90e36ac3b4d6c63629e3ed91ce750f2342ed536715c354ee` VALUES (103, "再び鎧を脱いだ、灼熱の騎士団長。実戦で培った判断力で、瞬時にバリアを展開し、障害物を無力化する。", 1, 11, 11, 0, 2, 350, 0, 113601, 2.5, 105, 0.071, 111);
INSERT INTO `v1_ca91bfe1895e62aa90e36ac3b4d6c63629e3ed91ce750f2342ed536715c354ee` VALUES (103, "水が苦手な、海辺の気まぐれ猫娘。浜に現れた美少女義賊は、対戦相手のスピードを奪いとる。", 0, 12, 12, 1, 3, 130, 0, 107901, 1.5, 120, 0.014, 112);
INSERT INTO `v1_ca91bfe1895e62aa90e36ac3b4d6c63629e3ed91ce750f2342ed536715c354ee` VALUES (105, "バカンスも効率第一な、海の傭兵。レースでも最高効率を求め、どんな状況でも隙のない走りを見せる。", 0, 13, 13, 0, 2, 200, 1, 108001, 1.5, 110, 0.022, 113);
INSERT INTO `v1_ca91bfe1895e62aa90e36ac3b4d6c63629e3ed91ce750f2342ed536715c354ee` VALUES (108, "真夏の太陽が良く似合う、海辺の　サレンママ。多才で器用、どんな　障害物もエレガントに越えていく。", 0, 14, 14, 0, 1, 160, 1, 110301, 2.5, 110, 0.031, 114);
INSERT INTO `v1_ca91bfe1895e62aa90e36ac3b4d6c63629e3ed91ce750f2342ed536715c354ee` VALUES (105, "海に嵐を呼ぶ夏のドジっ娘メイド。日頃から災難に慣れており、多少　のトラブルには動じたりしない。", 0, 15, 15, 1, 1, 130, 0, 107701, 0.5, 110, 0.036, 115);
INSERT INTO `v1_ca91bfe1895e62aa90e36ac3b4d6c63629e3ed91ce750f2342ed536715c354ee` VALUES (95, "粋な夏を愉しむ、若夏の姉御。　　流麗な身体捌きで、始・継・終と、UBを重ねるごとに、加速する。", 1, 16, 16, 0, 2, 350, 0, 113101, 3.5, 110, 0.048, 116);
INSERT INTO `v1_ca91bfe1895e62aa90e36ac3b4d6c63629e3ed91ce750f2342ed536715c354ee` VALUES (105, "夏のトキメキに触れた、オタク魔法少女。多彩な魔法を操り、少しずつ他の走者の速度を落とし続ける。", 0, 17, 17, 1, 3, 130, 0, 113301, 1.5, 105, 0.043, 117);
INSERT INTO `v1_ca91bfe1895e62aa90e36ac3b4d6c63629e3ed91ce750f2342ed536715c354ee` VALUES (95, "海獄に降臨せし、真夏の冥姫。　　レース後半に魔力を全解放し、　　蒼き疾風と成りて浜を駆け抜ける。", 0, 18, 18, 1, 2, 130, 0, 113201, 1.5, 105, 0.018, 118);
INSERT INTO `v1_ca91bfe1895e62aa90e36ac3b4d6c63629e3ed91ce750f2342ed536715c354ee` VALUES (108, "夏の夕を火花で彩る、渚の壊し屋。『壊し屋』の異名と過激な愛情は、対戦相手にプレッシャーを与える。", 0, 19, 19, 0, 2, 160, 1, 117001, 2.5, 110, 0.021, 119);
INSERT INTO `v1_ca91bfe1895e62aa90e36ac3b4d6c63629e3ed91ce750f2342ed536715c354ee` VALUES (105, "青春に生きる者を導く、夏の先生。夢へと邁進する聖母の加護が、その身をあらゆる困難から守る。", 1, 20, 20, 0, 1, 255, 0, 113501, 2.5, 110, 0.036, 120);
INSERT INTO `v1_ca91bfe1895e62aa90e36ac3b4d6c63629e3ed91ce750f2342ed536715c354ee` VALUES (105, "笑顔の応援が眩しい、夏の超能力　ガール。超能力を駆使して、どんな障害物もひとっ飛びで乗り越える。", 1, 21, 21, 0, 3, 350, 0, 113401, 2.5, 105, 0.02, 121);
INSERT INTO `v1_ca91bfe1895e62aa90e36ac3b4d6c63629e3ed91ce750f2342ed536715c354ee` VALUES (105, "海辺で大人の魅力を放つ、夏の　　セクシー先生。その魅力に囚われた対戦相手は、走りを乱してしまう。", 0, 22, 22, 1, 1, 130, 0, 110101, 2.5, 110, 0.018, 122);
INSERT INTO `v1_ca91bfe1895e62aa90e36ac3b4d6c63629e3ed91ce750f2342ed536715c354ee` VALUES (111, "水着も絶対外さない、夏のカリスマモデル。走りのバイブスは超テンアゲで、スピードはおにやば。", 0, 23, 23, 0, 3, 160, 1, 110001, 3.5, 105, 0.03, 123);
INSERT INTO `v1_ca91bfe1895e62aa90e36ac3b4d6c63629e3ed91ce750f2342ed536715c354ee` VALUES (103, "南の島も盛り上げる、真夏のアイドル。悪天候でも笑顔を絶やさず後半もリズムを上げて走り切る。", 0, 24, 24, 1, 1, 130, 0, 117201, 1.5, 110, 0.027, 124);
INSERT INTO `v1_ca91bfe1895e62aa90e36ac3b4d6c63629e3ed91ce750f2342ed536715c354ee` VALUES (108, "海原に美声を響かす、渚の歌姫。　守護の賛歌と精霊の加護により、　障害物から身を守る。", 0, 25, 25, 0, 2, 160, 1, 117301, 3.5, 105, 0.02, 125);
INSERT INTO `v1_ca91bfe1895e62aa90e36ac3b4d6c63629e3ed91ce750f2342ed536715c354ee` VALUES (105, "夏でも天邪鬼な、夕凪のテーラー。張り巡らされた魔法の糸で、他の走者の自由を奪う。", 1, 26, 26, 0, 3, 350, 0, 117401, 2.5, 110, 0.04, 126);
INSERT INTO `v1_ca91bfe1895e62aa90e36ac3b4d6c63629e3ed91ce750f2342ed536715c354ee` VALUES (105, "向日葵が良く似合う、海辺の　　　お姉ちゃん。秘密結社の一員で、　抜群の身体能力が一番の武器。", 1, 27, 27, 0, 1, 350, 0, 117101, 3.5, 110, 0.009, 127);
INSERT INTO `v1_ca91bfe1895e62aa90e36ac3b4d6c63629e3ed91ce750f2342ed536715c354ee` VALUES (105, "渚でおっとり、夏色うさぎっこ。　うさぎさんパワー全開で、ぴょん　ぴょんとコースを跳ね回る。", 1, 28, 28, 0, 1, 255, 0, 122901, 3.5, 120, 0.022, 128);
INSERT INTO `v1_ca91bfe1895e62aa90e36ac3b4d6c63629e3ed91ce750f2342ed536715c354ee` VALUES (105, "無邪気さ弾ける、夏色いたずら娘。砂浜でも、いたずらの準備は万端！レースに大波乱が巻き起こる！？", 0, 29, 29, 1, 3, 130, 0, 122801, 2.5, 110, 0.028, 129);
INSERT INTO `v1_ca91bfe1895e62aa90e36ac3b4d6c63629e3ed91ce750f2342ed536715c354ee` VALUES (108, "海でも真面目な、夏色優等生。　　高めた魔力を解き放ち、一瞬の内に他の走者を置き去りにする。", 0, 30, 30, 0, 2, 130, 1, 122701, 3.5, 105, 0.023, 130);
